import { useEffect, useState } from 'react';
import Loader from 'react-loaders';
import './index.scss';

const Contact = () => {
    return (
        <>
            <div className='container contact-page'>
                <div className='text-zone'>
                    <h1>
                        Contact Me
                    </h1>
                </div>
            </div>
            <Loader type='pacman' />
        </>
    )
}

export default Contact;
